/**
 * Fix the height of the table body of a DataTable with scrollY set
 */export default function fixTableHeight(a,b){var c=a.find(".dataTables_scrollHead").height(),d=a.find(".dataTables_filter").height()||0,e=a.find(".dataTables_length").height()||0,f=a.find(".dataTables_paginate").height()||0,g=e>d?e:d;a.find(".dataTables_scrollBody").css("max-height",b-c-g-f)}